// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// [v] 1. owner    
// [v] 2. 1~45     3 .
// [v] 3.     true or false (ex.10, 15, 20) ->  (n,y,n)
// [v] 4.     
// [v] 5. owner    
// [v] 6. 1 ~ 45   6 
// [v] 7. 6   2  3     ,     true  false  
// [v] 8.   
// 9.      

contract Lottery {
    address payable public owner; // owner 
    bool public gameStarted = false; //  
    uint256 constant internal MIN_BET_AMOUNT = 1 ether; //   , 1 
    uint public tmp_randomNumber; //     

    struct Game {
        uint[3] luckyNumbers; //   
        mapping(uint => bool) luckyNumExists; //      
        uint[6] finalNumbers; //  
        mapping(uint => bool) finalNumExists; //      
        mapping(uint => mapping(bool => uint)) bettingAmount; //   
        bool[3] winner; //      

        mapping(uint256 => BetInfo) _bets; //   
        uint256 _bets_tail; //  

        mapping(address => mapping(uint => bool)) userBets; //       
    }

    struct BetInfo {
        address payable bettor; //    
        uint256 betAmount; //  
        uint number; //   (0~2)
        bool guess; //  true or false
    }

    struct PayoutInfo {
        address bettor; //    
        uint256 payout; // 
    }

    mapping(address => uint256) public payouts; //   
    PayoutInfo[5] public topPayouts; //  5   

    mapping (uint256 => Game) private games; //   
    uint256 private _games_tail = 0; //  

    event GAME_STARTED(uint[3] luckyNumbers); //   
    event GAME_ENDED(uint[6] finalNumbers); //   
    event GAME_ANSWER(bool[3] winner); //   
    event BET(uint256 index, address bettor, uint256 amount, uint number, bool guess); //  
    event PAYOUT(address indexed bettor, uint256 amount); //   

    constructor() {
        owner = payable(msg.sender); //   
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function."); //    
        _;
    }

    function startGame() public onlyOwner {
        require(!gameStarted, "Game has already started."); //     

        Game storage game = games[_games_tail]; //   

        for (uint i = 0; i < 3; i++) {
            tmp_randomNumber = generateRandomNumber(i) % 45 + 1; //   
            while(game.luckyNumExists[tmp_randomNumber]) { //    
                tmp_randomNumber = generateRandomNumber(i + 12) % 45 + 1;
            }
            game.luckyNumbers[i] = tmp_randomNumber; //   
            game.luckyNumExists[tmp_randomNumber] = true; //     
        }

        gameStarted = true; //    
        emit GAME_STARTED(game.luckyNumbers); //    
    }

    function endGame() public onlyOwner {
        require(gameStarted, "Game has not started yet"); //   

        Game storage game = games[_games_tail]; //   

        for (uint i = 0; i < 6; i++) {
            tmp_randomNumber = generateRandomNumber(i) % 45 + 1; //   
            while(game.finalNumExists[tmp_randomNumber]) { //    
                tmp_randomNumber = generateRandomNumber(i + 12) % 45 + 1;
            }
            game.finalNumbers[i] = tmp_randomNumber; //   
            game.finalNumExists[tmp_randomNumber] = true; //     
        }

        emit GAME_ENDED(game.finalNumbers); //    

        determineWinners(); //     winner 

        popGame(); //   
        _games_tail++; //   
        gameStarted = false; //    
    }

    function determineWinners() private {
        Game storage game = games[_games_tail]; //   

        for (uint i = 0; i < game.luckyNumbers.length; i++) {
            game.winner[i] = game.finalNumExists[game.luckyNumbers[i]] ? true : false; //       
        }
        emit GAME_ANSWER(game.winner); //    

        //   
        calculatePayouts();
    }

    function calculatePayouts() private {
        Game storage game = games[_games_tail]; //   

        for (uint i = 0; i < 3; i++) {
            bool lucky = game.winner[i]; //    

            //     
            uint totalBettingAmount = game.bettingAmount[i][true] + game.bettingAmount[i][false]; //      

            if (totalBettingAmount > 0) {
                //  
                uint commission = (totalBettingAmount * 1) / 10; //   10%  

                //    
                for (uint j = 0; j < game._bets_tail; j++) {
                    BetInfo storage currentBet = game._bets[j];
                    if (currentBet.number == i && currentBet.guess == lucky) { //      
                        uint payout = (currentBet.betAmount * calculateOdds(i, lucky)) / 100; //  
                        payouts[currentBet.bettor] += payout; //   
                        updateTopPayouts(currentBet.bettor, payouts[currentBet.bettor]); //  5 
                        currentBet.bettor.transfer(payout); //  
                        emit PAYOUT(currentBet.bettor, payout); //    
                    }
                }
                //    
                owner.transfer(commission);
            }
        }
    }


    function calculateOdds(uint number, bool guess) public view returns (uint) {
        require(gameStarted, "Game has not started."); //   

        Game storage game = games[_games_tail]; //   
        uint totalBettingAmount = game.bettingAmount[number][true] + game.bettingAmount[number][false]; //   
        uint guessingAmount = game.bettingAmount[number][guess]; //     

        if (guessingAmount == 0 || totalBettingAmount == 0) { //      0      0 
            return 0;
        }

        uint winningAmount = (totalBettingAmount * 9) / 10; //   90%  
        uint odds = (winningAmount * 100) / guessingAmount; //   

        return odds;
    }


    function generateRandomNumber(uint seed) private view returns (uint) {
        return uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, seed))); //   
    }

    function popGame() private onlyOwner {
        delete games[_games_tail]; //    
    }

    function bet(uint number, bool guess) public payable returns(bool result) {
        Game storage game = games[_games_tail]; //   
        //   
        require(gameStarted, "Game has not started.");
        //    
        require(number >= 0 && number <= 2, "Number must be between 0 and 2");
        //   
        require(msg.value >= MIN_BET_AMOUNT, "Not enough ETH");
        //    
        require(!game.userBets[msg.sender][number], "Cannot bet on both true and false for the same number.");

        require(pushBet(number, guess), "pushBet failed!!");

        game.userBets[msg.sender][number] = true; //     

        emit BET(game._bets_tail - 1, msg.sender, msg.value, number, guess); //   

        return true;
    }

    function pushBet(uint number, bool guess) internal returns (bool) {
        Game storage game = games[_games_tail]; //   

        game.bettingAmount[number][guess] += msg.value; //     

        BetInfo memory betting; //     
        betting.bettor = payable(msg.sender);
        betting.betAmount = msg.value;
        betting.number = number;
        betting.guess = guess;

        game._bets[game._bets_tail] = betting; //   
        game._bets_tail++; //   

        return true;
    }

    function getBettingAmount(uint number, bool status) public view returns (uint) {
        return games[_games_tail].bettingAmount[number][status]; //      

    }

    //  5   
    function updateTopPayouts(address bettor, uint256 payout) private {
        for (uint i = 0; i < topPayouts.length; i++) {
            if (topPayouts[i].bettor == bettor) {
                topPayouts[i].payout = payout;
                sortTopPayouts();
                return;
            }
        }
        for (uint i = 0; i < topPayouts.length; i++) {
            if (topPayouts[i].payout < payout) {
                topPayouts[i] = PayoutInfo(bettor, payout);
                sortTopPayouts();
                return;
            }
        }
    }

    //  5  
    function sortTopPayouts() private {
        for (uint i = 0; i < topPayouts.length - 1; i++) {
            for (uint j = i + 1; j < topPayouts.length; j++) {
                if (topPayouts[i].payout < topPayouts[j].payout) {
                    PayoutInfo memory temp = topPayouts[i];
                    topPayouts[i] = topPayouts[j];
                    topPayouts[j] = temp;
                }
            }
        }
    }

    //  5  
    function getTopPayouts() public view returns (PayoutInfo[5] memory) {
        return topPayouts;
    }
}
